UML:TaggedValue.value:
@OneToMany(mappedBy = "location") private List<Copy> copies; 
@ManyToOne
@JoinColumn(name = "main_id") private Location mainLocation; 
@OneToMany(mappedBy = "mainLocation", cascade = CascadeType.REMOVE) private List<Location> subLocations = new ArrayList<>();

@OneToMany(mappedBy = "category") private List<Item> items; 
@ManyToOne
@JoinColumn(name = "main_id") private Category mainCategory; 
@OneToMany(mappedBy = "mainCategory", cascade = CascadeType.REMOVE) private List<Category> subCategories = new ArrayList<>();
